import React, { useState, useEffect } from "react";
import InputTextField from "../Components/TextField/TextField";
import Buttons from "../Components/Button/Button";
import Card from "@material-ui/core/Card";
import axios from "axios";
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles(() => ({
  card: {
    border: "2px solid grey",
  },
}));

const ViewBooking = () => {
  const [bookingDetails, setBookingDetails] = useState([]);
  const classes = useStyles();

  useEffect(() => {
    axios({
      method: "GET",
      url: "http://localhost:8080/displaybookings",
    }).then(() => {
      setBookingDetails(bookingDetails);
    });
  }, []);

  return (
    <Card className={classes.card}>
      {bookingDetails &&
        bookingDetails.map(() => {
          <p> {bookingDetails.firstName}</p>;
          <p> {bookingDetails.lastName}</p>;
          <p> {bookingDetails.bookingDate}</p>;
          <p> {bookingDetails.roomNumber}</p>;
          <p> {bookingDetails.bookingTime}</p>;
        })}
    </Card>
  );
};

export default ViewBooking;
